import React from 'react'
import um from './Users.module.css'

const Users = (props) => {
    return (

        props.Users.map(us => <div key={us.id} className={um.Main}>
            {us.name}
            <div>
                <img src={us.avalink}/>
            </div>
        </div>)
    )
}
export default Users
